import React, { useState } from 'react';
import ABTestService from '../../services/api';
import './CreateTest.css';
import { ABTestFormData } from '../../services/types';
import { v4 as uuidv4 } from 'uuid';
import { FormGroup, Label, Input, Button } from 'reactstrap';

interface CreateTestProps {
  setTestId: React.Dispatch<React.SetStateAction<string | null>>;
}

const CreateTest: React.FC<CreateTestProps> = ({ setTestId }) => {
  const [formData, setFormData] = useState<ABTestFormData>({
    test_id: uuidv4(),
    visitors: 0,
    sample_size: 0,
    start_date: '',
    end_date: '',
    variant_identifier: '',
    control_identifier: '',
    variant_segment: 0,
    control_segment: 0,
    website: '',
  });

  const handleInputChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = event.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (event: React.FormEvent<HTMLFormElement>) => {
    event.preventDefault();

    // Check if variant and control segments add up to 100
    if (formData.variant_segment + formData.control_segment !== 100) {
     // alert('The sum of the variant and control segments should equal 100');
      alert(formData.variant_segment + formData.control_segment)
      return;
    }

    try {
      await ABTestService.createTest(formData);
      setTestId(formData.test_id);
      alert('Test created successfully');
    } catch (error) {
      console.error('Error creating test:', error);
      alert('Failed to create test');
    }
  };

  return (
    <div className="create-test">
      <h2>Create Test</h2>
      <form className="create-test-form" onSubmit={handleSubmit}>
        <div className="form-card">
          <h3 className="form-card-title">General Information</h3>
          <FormGroup>
            <Label htmlFor="website">Site Name</Label>
            <Input
              type="text"
              id="website"
              name="website"
              value={formData.website}
              onChange={handleInputChange}
              required
            />
          </FormGroup>
          <FormGroup>
            <Label htmlFor="visitors">Visitors</Label>
            <Input
              type="number"
              id="visitors"
              name="visitors"
              value={formData.visitors}
              onChange={handleInputChange}
              required
            />
          </FormGroup>
          <FormGroup>
            <Label htmlFor="sample_size">Sample Size</Label>
            <Input
              type="number"
              id="sample_size"
              name="sample_size"
              value={formData.sample_size}
              onChange={handleInputChange}
              required
            />
          </FormGroup>
          <FormGroup>
            <Label htmlFor="start_date">Start Date</Label>
            <Input
              type="datetime-local"
              id="start_date"
              name="start_date"
              value={formData.start_date}
              onChange={handleInputChange}
              required
            />
          </FormGroup>
          <FormGroup>
            <Label htmlFor="end_date">End Date</Label>
            <Input
              type="datetime-local"
              id="end_date"
              name="end_date"
              value={formData.end_date}
              onChange={handleInputChange}
              required
            />
          </FormGroup>
        </div>
        <div className="form-card">
          <h3 className="form-card-title">A/B Test Details</h3>
          <p>
            For Variant and Control Identifiers, youcan only perform a comparison between two variables, and an identifier can only be the XPath of the element as displayed on the provided site.
</p>
<FormGroup>
<Label htmlFor="variant_identifier">Variant Identifier</Label>
<Input
           type="text"
           id="variant_identifier"
           name="variant_identifier"
           value={formData.variant_identifier}
           onChange={handleInputChange}
           required
         />
</FormGroup>
<FormGroup>
<Label htmlFor="control_identifier">Control Identifier</Label>
<Input
           type="text"
           id="control_identifier"
           name="control_identifier"
           value={formData.control_identifier}
           onChange={handleInputChange}
           required
         />
</FormGroup>
<p>
The Variant Segment and Control Segment represent the percentage of visitors who will see the Variant and Control versions of the site, respectively. The sum of these two values should equal 100%.
</p>
<FormGroup>
<Label htmlFor="variant_segment">Variant Segment</Label>
<Input
           type="number"
           id="variant_segment"
           name="variant_segment"
           value={formData.variant_segment}
           onChange={handleInputChange}
           required
         />
</FormGroup>
<FormGroup>
<Label htmlFor="control_segment">Control Segment</Label>
<Input
           type="number"
           id="control_segment"
           name="control_segment"
           value={formData.control_segment}
           onChange={handleInputChange}
           required
         />
</FormGroup>
</div>
<FormGroup>
<Button type="submit" color="primary">
Create Test
</Button>
</FormGroup>
</form>
</div>
);
};

export default CreateTest;
